import React, { Component } from 'react'

export class ListHeading extends Component {
    goHome = () => {
        this.props.updateListChanges(this.props.todoList);
        this.props.goHome();
    }
    render() {
        return (
            <div id="list_heading"
                onClick={this.goHome}
            >   @todo
            </div>
        )
    }
}

export default ListHeading
